import {useState,useEffect} from 'react'
import {endpoint} from './endpoint'

export function useEndpoint(){
    const [products,setProducts] = useState([])

    useEffect(() => {
        const fetchData = async () => {
            try {
                let resp = await endpoint()
                setProducts(JSON.parse(resp))
            } catch(e) {
                console.error(e);
            }
        };
        fetchData();
    }, [products] );

    return [products]
}
